    return (
        <div>
            <div style={{position:'absolute',left:'5%',display:'flex',flexDirection:'column',justifyContent:'center',marginTop:'1%',width:'100%'}}>
                <TextField style={{width:'20%',height:'10%'}} label="Search" type="search" variant="outlined"/>
                {cont}
            </div>
            {/* <div style={{display:'flex',justifyContent:'center',marginTop:'-1.2%',paddingTop:'0%',width:'100%'}}>
                {cont}
            </div> */}
        </div>
    );
}
